import React, { useEffect, useRef } from 'react';
import profilePic from '../images/profile.png'; // Import your image
import './About.css'; // Import the CSS file
import { FaHeartbeat, FaLaptopMedical, FaDna, FaBrain } from 'react-icons/fa';

function About() {
  const sectionRefs = useRef([]);

  useEffect(() => {
    const observerOptions = {
      root: null,
      rootMargin: '0px',
      threshold: 0.1
    };

    const observerCallback = (entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('animate');
        }
      });
    };

    const observer = new IntersectionObserver(observerCallback, observerOptions);

    sectionRefs.current.forEach((ref) => {
      if (ref) observer.observe(ref);
    });

    return () => {
      sectionRefs.current.forEach((ref) => {
        if (ref) observer.unobserve(ref);
      });
    };
  }, []);

  return (
    <div className="about-container">
      <div className="profile-header animate">
        <div className="profile-pic-container">
          <img src={profilePic} alt="Your Name" className="profile-pic" />
        </div>
        <h1 className="about-title">About Me</h1>
      </div>
      <div className="profile-content">
        <div ref={el => sectionRefs.current.push(el)} className="intro-card section">
          <h2>Hello, I'm Kenisha! </h2>
          <p>A <span className="highlight">Health Informatics Professional</span> with a keen interest in leveraging data and technology to drive healthcare innovation.</p>
        </div>
        
        <div ref={el => sectionRefs.current.push(el)} className="info-section section">
          <h3>My Focus Areas</h3>
          <ul className="focus-areas">
            <li><FaHeartbeat /> Digital Health Platforms</li>
            <li><FaLaptopMedical /> Telemedicine Solutions</li>
            <li><FaDna /> EHR Data Analytics</li>
            <li><FaBrain /> AI in Medical Diagnostics</li>
          </ul>
        </div>
        
        <div ref={el => sectionRefs.current.push(el)} className="info-section section">
          <h3>Professional Background</h3>
          <p>With a <span className="highlight">[Your Degree] in [Field]</span>, I've been at the forefront of merging healthcare and technology. My expertise includes:</p>
          <ul className="skills-list">
            <li>Electronic Health Records (EHR) Optimization</li>
            <li>Health Data Analytics</li>
            <li>Medical Device Integration</li>
          </ul>
        </div>
        
        <div ref={el => sectionRefs.current.push(el)} className="info-section section">
          <h3>Career Highlights</h3>
          <ul className="highlights-list">
            <li>Developed a machine learning algorithm for early detection of [specific disease]</li>
            <li>Led the implementation of a telemedicine platform, improving patient access by 40%</li>
            <li>Published research on [healthcare tech topic] in [journal/conference]</li>
          </ul>
        </div>
        
        <div ref={el => sectionRefs.current.push(el)} className="info-section section">
          <h3>Vision</h3>
          <p>I'm committed to leveraging technology to enhance patient outcomes, streamline healthcare processes, and make quality care more accessible to all.</p>
        </div>
        
        <div ref={el => sectionRefs.current.push(el)} className="fun-fact section">
          <h3>Did You Know?</h3>
          <p>I once coded a health app while recovering in a hospital bed â€“ talk about eating your own dog food!</p>
        </div>
      </div>
    </div>
  );
}

export default About;
